import React from 'react'

function NameList() {
    const names = ['Bruce', 'Clark', 'Diana']
    const nameList = names.map(name => <h2>{name}</h2>)
    // const nameList2 = names.map(name => names)

    const persons = [
        {
            id: 1,
            name: 'Bruce',
            age: 30,
            skill: 'React'
        },
        {
            id: 2,
            name: 'Clark',
            age: 30,
            skill: 'React'
        },
    ]

    return (
        <div>
            {
                nameList
            }   
        </div>
    )
}

export default NameList
